import React, { useContext, useState } from 'react';
import api from '../../services/api';
import { GlobalContext } from '../../context/GlobalState';
import Navbar from '../../components/Navbar/Navbar';
import { Container, FormHelperText, FormLabel } from '@material-ui/core';
import useForm, { FormValues, FormErrors, FormTouched } from '../../customHooks/useForm';
import {  FormCep, Label } from './styles';
import { validationSchema } from './valitation';
import { Controller } from 'react-hook-form';

interface ViaCep {
  bairro: string;
  cep: string;
  complemento: string;
  ddd: string;
  gia: string;
  ibge: string;
  localidade: string;
  logradouro: string;
  siafi: string;
  uf: string;
}

interface FormValues {
  name: string;
  cpf: string;
  email: string;
  neighborhood: string;
  cep: string;
  city: string;
  street: string;
  complement: string;
  state: string;
  number: string;
}

const Form: React.FC = () => {
  const { viaCep } = useContext(GlobalContext);
  const [userCep, setUserCep] = useState<ViaCep | null>(viaCep);

  const { handleSubmit, register, control, watch, formState: { errors, isValid }  } = useForm({resolver: yupResolver(validationSchema)});
  if (!viaCep) {
    throw new Error('Cep não encontrado.');
  }

  const handleFormSubmit = (data: FormValues) => {
    try {
      alert(
        `Foi enviado uma mensagem para o email cadastrado ${data.email} com as informações para dar prosseguimento ao cadastro.`
      );
    } catch (error) {
      alert(
        'Não foi possível realizar o cadastro. Reveja as informações e tente novamente.'
      );
    }

    console.log(data);
  };

  return (
    <Container>
      <Navbar />
      <FormCep onSubmit={handleFormSubmit}>
        <Label>Nome completo <span>(Obrigatório)</span>:</Label>

        <Controller
            name="nameModule"
            control={control}
            defaultValue={data?.nameModule}
            render={props => (
             <TextArea
                type="text"
                defaultValue={data?.nameModule}
                maxLength="100"
                placeholder='Insira aqui o título do conteúdo'
                name="nameModule"
                onChange={(e)=>{setData({...data, nameModule: e.target.value});props.field.onChange(e.target.value)}}
              />
            )}
          />
             <FormHelperText error={Boolean(errors?.name)}>
            {errors?.name?.message}
            </FormHelperText>
        <input
          name="name"
          placeholder="Nome Completo"
          value={values.name || ''}
          required
          maxLength={130}
          onChange={handleChange}
          onBlur={handleBlur}
        />

        <Label>CPF <span>(Obrigatório)</span>:</Label>
        <input
          name="cpf"
          required
          maxLength={11}
          pattern="[0-9]{11}"
          placeholder="Cpf, deve conter apenas números"
          value={values.cpf || ''}
          onChange={handleChange}
          onBlur={handleBlur}
        />

        <Label>Email <span>(Obrigatório)</span>:</Label>
        <input
          name="email"
          placeholder="Email"
          required
          pattern="[a-zA-Z0-9._-]{1,64}@[a-zA-Z0-9.-]{1,}\.[a-zA-Z]{2,}"
          value={values.email || ''}
          onChange={handleChange}
          onBlur={handleBlur}
        />

        <Label>CEP <span>(Obrigatório)</span>:</Label>
        <input
          name="cep"
          placeholder="Cep"
          pattern="[0-9]{5}-[0-9]{3}"
          required
          value={values.cep || userCep?.cep}
          onChange={handleChange}
          onBlur={handleBlur}
        />
        <Label>Bairro <span>(Obrigatório)</span>:</Label>

                <input
                    name="neighborhood"
                    placeholder="Bairro"
                    required
                    value={values.neighborhood || userCep?.bairro}
                    onChange={handleChange}
                    onBlur={handleBlur}
                    />

      <Label>Cidade <span>(Obrigatório)</span>:</Label>
         <input
                    name="city"
                    placeholder="Cidade"
                    required
                    value={values.city || userCep?.localidade}
                    onChange={handleChange}
                    onBlur={handleBlur}
                    />

                   <Label>Rua <span>(Obrigatório)</span>:</Label>
                <input
                    name="street"
                    placeholder="Rua"
                    required
                    value={values.street || userCep?.logradouro}
                    onChange={handleChange}
                    onBlur={handleBlur}
                    />
                <Label>Complemento:</Label>
                <input
                    name="complement"
                    placeholder="Complemento"
                    value={values.complement || ''}
                    onChange={handleChange}
                    onBlur={handleBlur}
                    />

                  <Label>Estado <span>(Obrigatório):</span></Label>
                <input
                    name="state"
                    placeholder="Estado"
                    required
                    value={values.state || userCep?.uf}
                    onChange={handleChange}
                    onBlur={handleBlur}
                    />

              <Label>Número <span>(Obrigatório):</span></Label>
                <input
                    name="number"
                    placeholder="Número"
                    required
                    value={values.number || ''}
                    onChange={handleChange}
                    onBlur={handleBlur}
                    />

                <button>Enviar Cadastro</button>
            </FormCep>
        </Container>
    );
};

export default Form;
